complete_model_interaction.output:
Step-by-step reasoning:
1. Psychological mechanisms: In the ultimatum game, responders often reject offers they perceive as unfair—even at a cost to themselves—to punish inequity. The Fehr–Schmidt model captures fairness concerns by penalizing deviations from equal splits. In cases where the responder’s share (split_self) is greater than the opponent’s (split_opp), the disutility comes from the advantageous inequality itself.
2. Mechanism interaction: The utility for accepting an offer increases with the absolute payoff but is reduced by the degree of inequity (i.e. how much more the responder gains relative to the opponent). Here, only the parameter corresponding to aversion to advantageous inequality (β) is needed.
3. Mathematical formulation: The utility function is linear, integrating both the monetary payoff and the fairness penalty. For an accepted offer, the utility is given by:
  Utility = split_self – β × (split_self – split_opp)
4. Learnable parameter: β is the single learnable parameter and is bounded to ensure finite estimates. A generous bound of [0, 10] is chosen.
5. Mapping to observable behavior: The model directly uses the offered splits (split_self and split_opp) from the dataset. A negative utility indicates a less favorable outcome, which helps explain rejection behavior even when it results in zero payoff.

Final model specification:

<MODEL>
U = split_self - beta*(split_self - split_opp)
</MODEL>

