A simple Fehr–Schmidt model for responder behavior in the ultimatum game that computes the utility of accepting an offer as the monetary payoff minus a fairness penalty proportional to the advantageous inequality. Only one learnable parameter, beta, is used to quantify fairness aversion.
</SUMMARY>

